import React from "react";
import Routes from "./components/Routes";
import styled from "styled-components";

const Wrapper = styled.div`
width: 100%,
max-width: 1400px
text-align: center,
color: red,
`;

function App() {
  return <Wrapper>Hello World</Wrapper>;
}

export default App;
